import React, { createContext, useContext, useEffect, useReducer } from 'react';
import { api } from '../services/api';

const CarsContext = createContext();

const initialState = {
  cars: [],
  loading: false,
  error: null
};

const carsReducer = (state, action) => {
  switch (action.type) {
    case 'SET_LOADING':
      return {
        ...state,
        loading: action.payload
      };
    case 'SET_ERROR':
      return {
        ...state,
        error: action.payload,
        loading: false
      };
    case 'CLEAR_ERROR':
      return {
        ...state,
        error: null
      };
    case 'INIT_CARS':
      return {
        ...state,
        cars: action.payload,
        loading: false,
        error: null
      };
    case 'ADD_CAR':
      return {
        ...state,
        cars: [...state.cars, action.payload],
        error: null
      };
    case 'UPDATE_CAR':
      return {
        ...state,
        cars: state.cars.map(car => 
          car._id === action.payload._id 
            ? action.payload
            : car
        ),
        error: null
      };
    case 'DELETE_CAR':
      return {
        ...state,
        cars: state.cars.filter(car => car._id !== action.payload),
        error: null
      };
    case 'BULK_UPDATE':
      return {
        ...state,
        cars: action.payload,
        error: null
      };
    default:
      return state;
  }
};

export const CarsProvider = ({ children }) => {
  const [state, dispatch] = useReducer(carsReducer, initialState);

  // Fetch cars from backend API
  const fetchCars = async () => {
    dispatch({ type: 'SET_LOADING', payload: true });

    try {
      const response = await api.get('/cars');
      dispatch({ type: 'INIT_CARS', payload: response.data.data });
    } catch (error) {
      console.error('Error fetching cars:', error);
      dispatch({ 
        type: 'SET_ERROR', 
        payload: error.response?.data?.message || 'Failed to fetch cars' 
      });
    }
  };

  // Initialize cars from backend
  useEffect(() => {
    fetchCars();
  }, []);

  // Add new car
  const addCar = async (carData) => {
    dispatch({ type: 'SET_LOADING', payload: true });

    try {
      const response = await api.post('/cars', carData);
      const newCar = response.data.data;
      dispatch({ type: 'ADD_CAR', payload: newCar });
      return true;
    } catch (error) {
      console.error('Error adding car:', error);
      dispatch({ 
        type: 'SET_ERROR', 
        payload: error.response?.data?.message || 'Failed to add car' 
      });
      return false;
    }
  };

  // Update existing car
  const updateCar = async (carData) => {
    dispatch({ type: 'SET_LOADING', payload: true });

    try {
      const response = await api.put(`/cars/${carData._id}`, carData);
      const updatedCar = response.data.data;
      dispatch({ type: 'UPDATE_CAR', payload: updatedCar });
      return true;
    } catch (error) {
      console.error('Error updating car:', error);
      dispatch({ 
        type: 'SET_ERROR', 
        payload: error.response?.data?.message || 'Failed to update car' 
      });
      return false;
    }
  };

  // Delete car
  const deleteCar = async (carId) => {
    dispatch({ type: 'SET_LOADING', payload: true });

    try {
      await api.delete(`/cars/${carId}`);
      dispatch({ type: 'DELETE_CAR', payload: carId });
      return true;
    } catch (error) {
      console.error('Error deleting car:', error);
      dispatch({ 
        type: 'SET_ERROR', 
        payload: error.response?.data?.message || 'Failed to delete car' 
      });
      return false;
    }
  };

  // Toggle featured status
  const toggleFeatured = async (carId) => {
    try {
      const car = state.cars.find(c => c._id === carId);
      if (car) {
        const response = await api.patch(`/cars/${carId}/toggle-featured`);
        const updatedCar = response.data.data;
        dispatch({ type: 'UPDATE_CAR', payload: updatedCar });
        return true;
      }
    } catch (error) {
      console.error('Error toggling featured status:', error);
      dispatch({ 
        type: 'SET_ERROR', 
        payload: error.response?.data?.message || 'Failed to toggle featured status' 
      });
      return false;
    }
  };

  // Refresh cars from backend
  const refreshCars = () => {
    fetchCars();
  };

  const value = {
    cars: state.cars,
    loading: state.loading,
    error: state.error,
    addCar,
    updateCar,
    deleteCar,
    toggleFeatured,
    refreshCars,
    clearError: () => dispatch({ type: 'CLEAR_ERROR' })
  };

  return (
    <CarsContext.Provider value={value}>
      {children}
    </CarsContext.Provider>
  );
};

export const useCars = () => {
  const context = useContext(CarsContext);
  if (!context) {
    throw new Error('useCars must be used within a CarsProvider');
  }
  return context;
};
